        return {
          error: true,
          submitted: false,
          userexist: false,
          emailexist: false,
          loggedin: false,
        };
      case "loggedin":
        return {
          error: true,
          submitted: state.submitted,
          userexist: state.userexist,
          emailexist: state.email,
          loggedin: true,
        };
      default:
        return state;
    }
  };
  const [state, dispatch] = useReducer(reducer, {
    error: false,
    submitted: false,
    userexist: false,
    emailexist: false,
    loggedin: false,
  });
  let users = {};
  useEffect(() => {
    try {
      axios.get(`http://127.0.0.1:5000/login`).then((res) => {
        console.log("result=", res);
        users = res;
        console.log("users", users);
      });
    } catch (e) {
      console.log(e);
    }
  });

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log("in submit", e);

    dispatch({ type: "loggedin" });
    e.preventDefault();
    if (
      username.current.value === "" ||
      email.current.value === "" ||
      password.current.value === ""
    ) {
      dispatch({ type: "error" });
    } else {
      const useraccount = users.data.some(
        (user) => user.username === username.current.value
      );
      if (useraccount) {
        dispatch({ type: "usernameexist" });
      }
      const emailaccount = users.data.some(
        (user) => user.email === email.current.value
      );
      if (emailaccount) {
        dispatch({ type: "emailexist" });
