        try {
          axios.post("http://127.0.0.1:5000/cart", data).then((response) => {
            console.log(response.data);
          });
        } catch (e) {
          console.log("Item cannot be added to cart", e);
        }
      }
    }
  };

  const Successmessage = () => {
    return (
      <div
        className="success"
        style={{
          display: state.submitted ? "" : "none",
        }}
      >
        <h1>User {username.current.value} successfully registered!!</h1>
      </div>
    );
  };

  const Errormessage = () => {
    return (
      <div
        className="error"
        style={{
          display: state.error ? "" : "none",
        }}
      >
        <h1>Please enter all the fields</h1>
      </div>
    );
  };
  const Existingusername = () => {
    return (
      <div
        className="error"
        style={{
          display: state.userexist ? "" : "none",
        }}
      >
        <h1>Username alredy exist</h1>
      </div>
    );
  };
  const Existingemail = () => {
    return (
      <div
        className="error"
        style={{
          display: state.emailexist ? "" : "none",
        }}
      >
        <h1>Email alredy exist</h1>
      </div>
    );
  };

  return (
    <>
      <div className={newuserStyle.inputform}>
        <p>Welcome To The Coffee Shop</p>
        <form onSubmit={handleSubmit}>
          <input
            className={newuserStyle.btn}
            type="text"
            name="Username"
            ref={username}
            placeholder="Username"
          />
